import React from 'react';
import {Header, Footer} from './Layouts';
import About from './About';
import Schedule from './Schedule';
import Nav from './Nav';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <About />
        <Schedule />
      </div>
    </Router>

  );
}

export default App;
